[iOS] App crashes when clipboard set data with null  ## Steps to Reproduce

1. Execute `flutter run` on the code sample 
`
  void copy() {
    Clipboard.setData(const ClipboardData(text: null));
  }
`
2. Tap the copy button

**Expected results:** 
do nothing 

**Actual results:** 
app crashes

