[pigeon] enums parameters do not work with the `dartHostTestHandler` When using:
```dart
enum StorageDirectory {
  music,
  podcasts,
  ringtones,
  alarms,
  notifications,
  pictures,
  movies,
  downloads,
  dcim,
  documents,
}

@HostApi(dartHostTestHandler: 'TestPathProviderApi')
abstract class PathProviderApi {
  List<String?> getExternalStoragePaths(StorageDirectory directory);
}
```

Pigeon will generate a dart file like:
```dart
  Future<List<String?>> getExternalStoragePaths(StorageDirectory arg_directory) async {
    final BasicMessageChannel<Object?> channel = BasicMessageChannel<Object?>(
        'dev.flutter.pigeon.PathProviderApi.getExternalStoragePaths', codec, binaryMessenger: _binaryMessenger);
    final Map<Object?, Object?>? replyMap =
        await channel.send(<Object?>[arg_directory.index]) as Map<Object?, Object?>?;
    ...
  }
```

And a test file like:
```dart
        channel.setMockMessageHandler((Object? message) async {
          assert(message != null, 'Argument for dev.flutter.pigeon.PathProviderApi.getExternalStoragePaths was null.');
          final List<Object?> args = (message as List<Object?>?)!;
          final StorageDirectory? arg_directory = (args[0] as StorageDirectory?);
          assert(arg_directory != null, 'Argument for dev.flutter.pigeon.PathProviderApi.getExternalStoragePaths was null, expected non-null StorageDirectory.');
          final List<String?> output = api.getExternalStoragePaths(arg_directory!);
          return <Object?, Object?>{'result': output};
        });
```

Which causes an `int` to be cast as a `StorageDirectory?`: `type 'int' is not a subtype of type 'StorageDirectory?' in type cast`

I guess it makes sense to make the test generator take in an int which it transforms to a StorageDirectory in this case.

[go_router] Support asynchronous redirects This is a proposal to change GoRouterRedirect to an asynchronous function. 

```dart
typedef GoRouterRedirect = Future<String?> Function(GoRouterState state);
```

This would allow a redirect to make asynchronous calls, for example to check if the user is signed in:

```dart
redirect: (state) async {
  final signedIn = await _appState.auth.isSignedIn();
  if (!signedIn) return '/signin';
  return null;
},
```

