[Windows] Overlay flickering when the cursor is hovered  Issue seen on Windows.

## Steps to Reproduce

1. Execute `flutter run` on the code sample on a desktop platform
2. Click on the FAB and hover the mouse over the overlay shown

**Expected results:** No anti-alias and edge flickering

**Actual results:** Odd flickering seen

![recording](https://user-images.githubusercontent.com/72562119/179740128-2c96d4d9-235a-4188-8e9a-67cc07145060.gif)

<details>
<summary>Code sample</summary>

```dart
import 'package:flutter/material.dart';

void main() {
  runApp(const MyApp());
}

class MyApp extends StatelessWidget {
  const MyApp({super.key});

  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      title: 'Flutter Demo',
      theme: ThemeData(primarySwatch: Colors.blue),
      home: const MyHomePage(title: 'Flutter Demo Home Page'),
    );
  }
}

class MyHomePage extends StatefulWidget {
  const MyHomePage({super.key, required this.title});

  final String title;

  @override
  State<MyHomePage> createState() => _MyHomePageState();
}

class _MyHomePageState extends State<MyHomePage> {
  int _counter = 0;
  OverlayEntry? _overlay;
  final LayerLink _layerLink = LayerLink();

  void _incrementCounter() {
    setState(() {
      _counter++;
    });

    if (_overlay != null) {
      _overlay!.remove();
      _overlay = null;
    } else {
      _overlay = OverlayEntry(
        builder: (BuildContext context) {
          return ToolbarOverlay(layerLink: _layerLink);
        }
      );
      Overlay.of(context, rootOverlay: true)!.insert(_overlay!);
    }
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(title: Text(widget.title)),
      body: Center(
        child: Column(
          mainAxisAlignment: MainAxisAlignment.center,
          children: <Widget>[
            const Text(
              'You have pushed the button this many times:',
            ),
            CompositedTransformTarget(
              link: _layerLink,
              child: Text(
                '$_counter',
                style: Theme.of(context).textTheme.headline4,
              ),
            ),
          ],
        ),
      ),
      floatingActionButton: FloatingActionButton(
        onPressed: _incrementCounter,
        tooltip: 'Increment',
        child: const Icon(Icons.add),
      ),
    );
  }
}

class ToolbarOverlay extends StatefulWidget {
  const ToolbarOverlay({super.key, required this.layerLink});

  final LayerLink layerLink;

  @override
  State<ToolbarOverlay> createState() => _LinkToolbarState();
}

class _LinkToolbarState extends State<ToolbarOverlay> with SingleTickerProviderStateMixin {
  late AnimationController _controller;
  Animation<double> get _opacity => _controller.view;

  @override
  void initState() {
    super.initState();
    _controller = AnimationController(duration: const Duration(milliseconds: 150), vsync: this);
    _controller.forward();
  }

  @override
  void didUpdateWidget(ToolbarOverlay oldWidget) {
    super.didUpdateWidget(oldWidget);
  }

  @override
  void dispose() {
    _controller.dispose();
    super.dispose();
  }

  @override
  Widget build(BuildContext context) {
    return CompositedTransformFollower(
      link: widget.layerLink,
