late final incorrectly claims to already be initialized Use `compute` from flutter foundation with a function that asynchronously throws an error. The following stack trace is printed.

```
E/flutter (27630): [ERROR:flutter/runtime/dart_vm_initializer.cc(41)] Unhandled Exception: LateInitializationError: Local 'computationResult' has already been initialized.
E/flutter (27630): #0      LateError._throwLocalAlreadyInitialized (dart:_internal-patch/internal_patch.dart:214)
E/flutter (27630): #1      _spawn (package:flutter/src/foundation/_isolates_io.dart:129)
E/flutter (27630): <asynchronous suspension>
```

The code is as follows: It does not seem possible for `computationResult` to be set twice

```dart
/// The spawn point MUST guarantee only one result event is sent through the
/// [SendPort.send] be it directly or indirectly i.e. [Isolate.exit].
///
/// In case an [Error] or [Exception] are thrown AFTER the data
/// is sent, they will NOT be handled or reported by the main [Isolate] because
/// it stops listening after the first event is received.
///
/// Also use the helpers [_buildSuccessResponse] and [_buildErrorResponse] to
/// build the response
Future<void> _spawn<Q, R>(_IsolateConfiguration<Q, R> configuration) async {
  late final List<dynamic> computationResult;

  try {
    computationResult = _buildSuccessResponse(await configuration.applyAndTime());
  } catch (e, s) {
    computationResult = _buildErrorResponse(e, s);
  }

  Isolate.exit(configuration.resultPort, computationResult);
}
```

toImageSync should use kPremul_SkAlphaType Right now it's using kUnpremul_SkAlphaType, which is resulting in darker anti-aliasing around edges, e.g. compare the square on bottom to the one on top:

<img width="127" alt="image" src="https://user-images.githubusercontent.com/8620741/184067414-71c3a08d-865a-4723-8a40-3640886ec2f2.png">

They're made form the same picture drawn like this:

```dart
Future<List<ui.Image>> drawImage() async {
  var recorder = ui.PictureRecorder();
  var canvas = ui.Canvas(recorder);
  canvas.drawRect(ui.Rect.fromLTWH(20, 20, 100, 100),
      ui.Paint()..color = ui.Color(0xFFFF6D00));
  var picture = recorder.endRecording();
  var toImageImage = await picture.toImage(200, 200);
  var toImageSyncImage = picture.toImageSync(200, 200);
  return [toImageImage, toImageSyncImage];
}
```

The `toImage` image is on top, the `toImageSync` image is on bottom. Changing https://github.com/flutter/engine/blob/5f92d3668c7a172be23df13eebd24ab7e7df29ee/lib/ui/painting/picture.cc#L71 to `kPremul_SkAlphaType` seems to fix this, but probably deserves to be tested to make sure it works - Im' pretty sure I tried unpremul at one point to try to get Linux to be happy, before finally just putting Linux on the software path for now.

@jonahwilliams fyi. If you don't get to this first, I'll pick it up when I come back next week. We may want a golden test that asserts the bytes are the same between these calls.

