The application successfully launches (Task Manager confirms the process) however, fails to open a window. This Project runs perfectly fine in debug mode.

After looking at `windows/runner/main.cpp`, it was found that the `Win32Window::window.createAndShow()` function was split into `Win32Window::window.create()` and `Win32Window::window.show()` but the `flutter create  .  --platform windows` fails to generate this in the main.cpp.

This is the default `main.cpp`:

```
...
  if (!window.Create(L"XXXXXX", origin, size))
  {
    return EXIT_FAILURE;
  }

  window.SetQuitOnClose(true);

  ::MSG msg;
  while (::GetMessage(&msg, nullptr, 0, 0))
  {
    ::TranslateMessage(&msg);
    ::DispatchMessage(&msg);
  }

  ::CoUninitialize();
  return EXIT_SUCCESS;
...
```

Fixing it this way works:
```
  if (!window.Create(L"XXXXX", origin, size))
  {
    return EXIT_FAILURE;
  }


//Fix Begin: Use the Show method
  if (!window.Show())
  {
    return EXIT_FAILURE;
  }
//Fix End

  window.SetQuitOnClose(true);

  ::MSG msg;
  while (::GetMessage(&msg, nullptr, 0, 0))
  {
    ::TranslateMessage(&msg);
    ::DispatchMessage(&msg);
  }

  ::CoUninitialize();
  return EXIT_SUCCESS;
```

