[Bug] App Crashes after adopting Hybrid Composition In my current developing project, we use the [flutter_inappwebview](https://pub.dev/packages/flutter_inappwebview) to show partners' website inside the app. Recently, we modify the `flutter_inappwebview` to make it support hybrid composition. However, the app becomes easily crashes after doing certain operations. After investigating, I found a way to reproduce this crash by 100%.

I create a simple project to reproduce this crash, this project simply provides a `Click Me` Button. When pressing the `Click Me` button, a page route is pushed with a `Stack` composed of a custom `TextPlatformView` widget and a `CircularProgressIndicator` widget.  The detailed reproduced steps are written in the `Steps to Reproduce` section below.

Note:  The `TextPlatformView.dart` widget is created by following [Hybrid-Composition](https://github.com/flutter/flutter/wiki/Hybrid-Composition), it has a corresponding `TextPlatformView.java` native `TextView` in the platform side. 

**TextPlatformView.java**
```java
class TextPlatformView implements PlatformView {
    @NonNull private final TextView textView;

    TextPlatformView(@NonNull Context context, int id, @Nullable Map<String, Object> creationParams) {
        textView = new TextView(context);
        textView.setTextSize(72);
        textView.setBackgroundColor(Color.rgb(255, 255, 255));
        textView.setText("Rendered on a native Android view (id: " + id + ")");
    }

    @NonNull
    @Override
    public View getView() {
        return textView;
    }

    @Override
    public void dispose() {}
}
```
**TextPlatformViewFactory.java**
```java
class TextPlatformViewFactory extends PlatformViewFactory {
    TextPlatformViewFactory() {
        super(StandardMessageCodec.INSTANCE);
    }

    @NonNull
    @Override
    public PlatformView create(@NonNull Context context, int id, @Nullable Object args) {
        final Map<String, Object> creationParams = (Map<String, Object>) args;
        return new TextPlatformView(context, id, creationParams);
    }
}
```
**MainActivity.kt**
```kotlin
class MainActivity : FlutterActivity() {
    override fun configureFlutterEngine(@NonNull flutterEngine: FlutterEngine) {
        flutterEngine
                .platformViewsController
                .registry
                .registerViewFactory("hybrid-view-type", TextPlatformViewFactory())
    }
}
```
**TextPlatformView.dart**
```dart
class TextPlatformView extends StatelessWidget {
  Widget build(BuildContext context) {
    // This is used in the platform side to register the view.
    final String viewType = 'hybrid-view-type';
    // Pass parameters to the platform side.
    final Map<String, dynamic> creationParams = <String, dynamic>{};

    return PlatformViewLink(
      viewType: viewType,
      surfaceFactory: (BuildContext context, PlatformViewController controller) {
        return AndroidViewSurface(
          controller: controller,
          gestureRecognizers: const <Factory<OneSequenceGestureRecognizer>>{},
          hitTestBehavior: PlatformViewHitTestBehavior.opaque,
        );
      },
      onCreatePlatformView: (PlatformViewCreationParams params) {
        return PlatformViewsService.initSurfaceAndroidView(
          id: params.id,
          viewType: viewType,
          layoutDirection: TextDirection.ltr,
          creationParams: creationParams,
          creationParamsCodec: StandardMessageCodec(),
        )
          ..addOnPlatformViewCreatedListener(params.onPlatformViewCreated)
          ..create();
      },
    );
  }
}

```
**MyApp Widget**
```dart
class MyApp extends StatelessWidget {
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      title: 'Hybrid Composition Crash Demo',
      theme: ThemeData(
        primarySwatch: Colors.blue,
        visualDensity: VisualDensity.adaptivePlatformDensity,
      ),
      home: MyHomePage(title: 'Demo Home Page'),
    );
  }
}

class MyHomePage extends StatefulWidget {
  MyHomePage({Key key, this.title}) : super(key: key);

  final String title;

  @override
  _MyHomePageState createState() => _MyHomePageState();
}

class _MyHomePageState extends State<MyHomePage> {
  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text(widget.title),
      ),
      body: Center(
        child: FlatButton(
          color: Colors.red,
          child: Text('Click Me'),
          onPressed: _launchHybridCompositionViewPage,
        ),
      ),
    );
  }

  void _launchHybridCompositionViewPage() {
    final body = Stack(
      fit: StackFit.expand,
      children: [
        TextPlatformView(),
        Center(child: CircularProgressIndicator()),
      ],
    );
    Navigator.of(context).push(MaterialPageRoute(builder: (context) => Scaffold(body: body)));
  }
}
```

