TextInputClient should receive correct composing range or ignore it on Flutter Web Currently `TextInputClient` on Flutter Web always receives a `TextEditingValue` with an empty `composing` range while the composing text is mixed inside `TextEditingValue.text` with no hint indicating their nature (The composing range is erased). This behavior is off spec.

This is due to current web engine only listens to `onInput` event and lacks ability to infer composing range https://github.com/flutter/engine/blob/7d927dd4a4cb1d5a4dc713b5349dfc3578921b97/lib/web_ui/lib/src/engine/text_editing/text_editing.dart#L232

## Demo

