ScrollPosition.isScrollingNotifier returns false when using scroll-wheel and two-finger gesture in trackpad I have only tried this on a mac device, as a mac app and a web app. When using the trackpad to scroll a view, the  `ScrollPosition.isScrollingNotifier`
returns false.
If I scroll by clicking and dragging it, the notifier returns true. 

At least on macos, the default way of scrolling into views is using the two-finger gesture. If you click and drag inside a native app, this one does not scroll, but a Flutter app does.


## Steps to Reproduce
```dart
