[google_maps_flutter] Initial TileOverlay added twice in Android Creating a GoogleMaps object with an initial TileOverlay adds the TileOverlay to the Google Maps Controller twice in the Android platform code. Specifically, in `TileOverlaysController.java`, in the function `addTileOverlay`, we run `googleMap.addTileOverlay(options)` twice for the same TileOverlay whenever an initial TileOverlay is set. I've made a workaround by running
```
    if (tileOverlayIdToController.containsKey(tileOverlayId)) {
      // already contains this tile overlay, remove it first
      removeTileOverlay(tileOverlayId);
    }
```
inside of the `addTileOverlay` method, but it does not address the issue of doubly adding the initial TileOverlays.

To confirm this, I added a Log statement to the `addTileOverlay` function and found it running twice; first it runs when `updateInitialTileOverlays` runs in GoogleMapController.java and adds my initial Tile Overlay. It runs again when `didUpdateWidget` runs in google_map.dart and adds the same TileOverlay to the GoogleMap object.

This has the effect of being unable to manage the initial added TileOverlay object. For example, setting state to an empty TileOverlay set in the GoogleMaps widget will show artifacts from the previously doubly-added TileOverlay.

To reproduce this error, modify the example TileOverlayPage (from example):
```class TileOverlayBodyState extends State<TileOverlayBody> {
  TileOverlayBodyState();

  GoogleMapController controller;
  TileOverlay _tileOverlay;

  void _onMapCreated(GoogleMapController controller) {
    this.controller = controller;
  }

  @override
  void dispose() {
    super.dispose();
  }

  @override
  void initState() {
    super.initState();
    _addTileOverlay();
  }

/// ...
```
I simply modified it to run `_addTileOverlay()` in the `initState()` function. Tapping "Remove tile overlay" in the example now does nothing. You can repeatedly tap "Remove tile overlay" and nothing will happen since the initial tile overlay was added twice to the GoogleMaps object in Android and has lost the reference at this point.

