macOS: Attempted to send a key down event when no keys are in keysPressed.  Happens consistently  when application has multiple windows during switching between windows (CMD + `)

Reason why this happen is the following code in `FlutterViewController.mm`:

```objc
- (void)flagsChanged:(NSEvent*)event {
  if (event.modifierFlags < _keyboardState.previously_pressed_flags) {
    [self keyUp:event];
  } else {
    [self keyDown:event];
  }
  _keyboardState.previously_pressed_flags = event.modifierFlags;
}
```

What happens is, that old window (being switched from) gets `flagsChanged:` with CMD flag set, while new windows gets `flagsChanged:` called without the CMD flag set, which is same as ` _keyboardState.previously_pressed_flags `. This causes `keyDown` event generated, but without any modifier flag.

Simply changing the condition to

```objc
  if (event.modifierFlags < _keyboardState.previously_pressed_flags) {
    [self keyUp:event];
  } else if (event.modifierFlags > _keyboardState.previously_pressed_flags) {
    [self keyDown:event];
  }
```

seems to fix the problem.

[macOS/Windows] TextField exception when pasting via ctrl-V after clearing the field ## Steps to Reproduce

1. Run `flutter create bug`.
2. Add a TextField with an explicit TextEditingController
3. Set onEditingComplete to clear the controller's text
4. Press enter, then ctrl-V a piece of text from your clipboard

**Expected results:**

Text from clipboard pastes into the empty text field.

**Actual results:**

selection.textBefore(text) from editable.dart produces an exception and the clipboard data is not pasted:

> [ERROR:flutter/lib/ui/ui_dart_state.cc(186)] Unhandled Exception: RangeError: Value not in range: -1
> #0      _StringBase.substring (dart:core-patch/string_patch.dart:399:7)
> #1      TextRange.textBefore (dart:ui/text.dart:1533:17)
> #2      RenderEditable._handleShortcuts
> package:flutter/閳/rendering/editable.dart:822
> <asynchronous suspension>

**Solved by:**

Adding a check before the value is assigned a new TextEditingValue:
```
var newString = data.text!;
if (text.isNotEmpty) {
          newString = selection.textBefore(text) +
              data.text! +
              selection.textAfter(text);
}
```

