[in-app-purchase] inconsistency between documentation and example code A snippet from the example code from the readme:

```dart
void _listenToPurchaseUpdated(List<PurchaseDetails> purchaseDetailsList) {
  purchaseDetailsList.forEach((PurchaseDetails purchaseDetails) async {
    if (purchaseDetails.status == PurchaseStatus.pending) {
      _showPendingUI();
    } else {
      if (purchaseDetails.status == PurchaseStatus.error) {
        _handleError(purchaseDetails.error!);
      } else if (purchaseDetails.status == PurchaseStatus.purchased) {
        bool valid = await _verifyPurchase(purchaseDetails);
        if (valid) {
          _deliverProduct(purchaseDetails);
        } else {
          _handleInvalidPurchase(purchaseDetails);
          return;
        }
      }
      if (purchaseDetails.pendingCompletePurchase) {
        await InAppPurchaseConnection.instance
            .completePurchase(purchaseDetails);
      }
    }
  });
}
```

there is a `return` statement after `_handleInvalidPurchase(purchaseDetails);`.

From the documentation of `completePurchase`:
```dart
/// You are responsible for completing every [PurchaseDetails] whose
/// [PurchaseDetails.status] is [PurchaseStatus.purchased]. Additionally on iOS,
/// the purchase needs to be completed if the [PurchaseDetails.status] is [PurchaseStatus.error].
/// Completing a [PurchaseStatus.pending] purchase will cause an exception.
/// For convenience, [PurchaseDetails.pendingCompletePurchase] indicates if a purchase is pending for completion.
```
it looks to me that either `completePurchase` must be called in `_handleInvalidPurchase` (in which case it would be nice to point it out in the snippet), or the `return` statement should be removed.

Or am I missing something?

