pigeon 0.2.1 generate invalid iOS code when async Future<void> function. # Steps to reproduce 
Following is target schema code. nativecall() does not return anything, but it will return as soon as some long task is completed.

```
@HostApi()
abstract class Api {
  @async
  void nativecall();
}
```

**Generated code**
```
// dart
  Future<void> nativecall() async {
    final BasicMessageChannel<Object?> channel = BasicMessageChannel<Object?>(
        'dev.flutter.pigeon.Api.nativecall', const StandardMessageCodec(), binaryMessenger: _binaryMessenger);
    final Map<Object?, Object?>? replyMap =
        await channel.send(null) as Map<Object?, Object?>?;
    if (replyMap == null) {  // 1. it expects replyMap is *not* null
      throw PlatformException(
        code: 'channel-error',
        message: 'Unable to establish connection on channel.',
        details: null,
      );
    } else if (replyMap['error'] != null) {
      final Map<Object?, Object?> error = (replyMap['error'] as Map<Object?, Object?>?)!;
      throw PlatformException(
        code: (error['code'] as String?)!,
        message: error['message'] as String?,
        details: error['details'],
      );
    } else {
      // noop
    }
  }
```

```
// objc
  {
    FlutterBasicMessageChannel *channel =
      [FlutterBasicMessageChannel
        messageChannelWithName:@"dev.flutter.pigeon.Api.nativecall"
        binaryMessenger:binaryMessenger];
    if (api) {
      [channel setMessageHandler:^(id _Nullable message, FlutterReply callback) {
        [api nativecall:^(FlutterError *_Nullable error) {
          callback(error);  // 2. There is no *result* value. <=> replyMap is null
        }];
      }];
    }
    else {
      [channel setMessageHandler:nil];
    }
  }
```
**Result**

Runner shows following message.
"Unhandled Exception: PlatformException(channel-error, Unable to establish connection on channel., null, null)"

This is because dart-side expects replyMap is not null (1.) but objc-side pass nothing (2.) so replyMap becomes null.

**suggestion**

I think callback should fix as 'callback(wrapResult(nil, error))'

