import 'package:video_player/video_player.dart';

// This widget allow passing down a new videoUrl
// which will trigger a cross-fade into the new video.
//
// It is also possible to pass down a different playCounter
// value at some point to cause the widget to re-play
// the current video.
class MyVideoPlayer extends StatefulWidget {
  final String videoUrl;
  final Function? onVideoEnded;

  /// if playCounter changes value the video will be re-started.
  final int playCounter;

  MyVideoPlayer(this.videoUrl, {this.onVideoEnded, required this.playCounter, Key? key})
      : super(key: key);

  @override
  _MyVideoPlayerState createState() => _MyVideoPlayerState();
}

class _MyVideoPlayerState extends State<MyVideoPlayer> {
  VideoPlayerController? _controller;
  List<VideoPlayerController> _oldControllers = [];
  late bool _mayShowSpinner;
  bool _oldReachedEnd = false;
  late ValueKey<String> _videoKey;

  @override
  void initState() {
    this._setUrl(this.widget.videoUrl);
    this._videoKey = ValueKey<String>(this.widget.videoUrl);
    super.initState();
  }

  void _delayMayShowSpinner() {
    this._mayShowSpinner = false;
    Future<void>.delayed(Duration(milliseconds: 500), () {
      if (!this.mounted) return;
      this.setState(() {
        this._mayShowSpinner = true;
      });
    });
  }

  @override
  void didUpdateWidget(covariant MyVideoPlayer oldWidget) {
    if (this.widget.videoUrl != oldWidget.videoUrl) {
      this._setUrl(this.widget.videoUrl);
    } else if (this.widget.playCounter != oldWidget.playCounter) {
      () async {
        await this._controller!.seekTo(Duration.zero);
        await this._controller!.play();
      }();
    }
    super.didUpdateWidget(oldWidget);
  }

  Future<VideoPlayerController?> _createController(String url) async {
    // On web, we don't use VideoCache. Cache is probably better handled
    // by the ServiceWorker on web.

    // bug_blink: stripped out usage of VideoCache
    if (!this.mounted) return null;
    return VideoPlayerController.network(url);
  }

  /// Wait on video to load and setup event listeners.
  /// if loading fails the video is removed from videoCache.
  /// (which is why url is a required parameter)
  Future<void> _awaitLoadVideo(
    VideoPlayerController controller,
    String url,
  ) async {
    print('Play video $url');
    try {
      print('Load video $url');
      await controller.initialize();
      if (!this.mounted) return;
      if (this._oldControllers.length == 0) {
        this.setState(() {
          controller.play(); // Autoplay
        });
      }
      print('Video loaded $url');
    } catch (e) {
      if (!this.mounted) return;
      // bug_blink: stripped out usage of VideoCache
      // bug_blink: inlined showAlert:
      await showDialog(
        context: context,
        builder: (BuildContext context) {
        return AlertDialog(
          title: Text('Oops!'),
          content: Text('Failed to load video\n\n$url'),
          actions: <Widget>[
            TextButton( // bug_blink: changed to standard button
                child: Text('Ok'),
                onPressed: () {
                  // close alert
                  Navigator.of(context).pop();
                }),
          ],
        );
        },
      );
      // TODO: Signal that video loading failed?
      return;
    }
  }

  void _addListener(VideoPlayerController controller) {
    controller.addListener(this._listener);
  }

  // video_player listener.
  // call widget callback when reaching end.
  void _listener() {
    if (!this.mounted) return;
    final reachedEnd =
        this._controller!.value.position >= this._controller!.value.duration &&
        this._controller!.value.duration.inMicroseconds > 0;
    if (reachedEnd &&
        !this._oldReachedEnd &&
        this.widget.onVideoEnded != null) {
      this.widget.onVideoEnded!();
    }
    this._oldReachedEnd = reachedEnd;
  }

  Future<VideoPlayerController?> _initController(String url) async {
    if (!this.mounted) return null;
    final controller = await this._createController(url);
    if (controller == null) return null;

    await this._awaitLoadVideo(controller, url);
    if (!this.mounted) {
      controller.dispose();
      return null;
    }
    this._addListener(controller);
    if (!this.mounted) return controller;
    print('Video aspect ratio: ${controller.value.aspectRatio}');
    return controller;
  }

  Future<void> _setUrl(String url) async {
    if (!this.mounted) return;

    // Don't show spinner directly if loading is fast
    this._delayMayShowSpinner();

    if (this._controller != null) {
      this._controller!.removeListener(this._listener);
      // Animating while playing is bad for performance => pause
      this._controller!.pause();
      this._oldControllers.add(this._controller!);
    }

    final newController = await this._initController(url);
    if (!this.mounted) {
      newController?.dispose();
      return;
    }
    setState(() {
      // Start animating in new video
      this._controller = newController;
      this._videoKey = ValueKey<String>(url);
    });
  }

  @override
  void dispose() {
    this._oldControllers.forEach((controller) {
      controller.dispose();
    });
    this._oldControllers.clear();
    this._controller?.dispose();
    this._controller = null;
    super.dispose();
  }

  @override
  Widget build(BuildContext context) {
    return (this._controller != null &&
                this._controller!.value.isInitialized) ||
            (this._controller != null && this._oldControllers.length > 0)
        ? AnimatedSwitcher(
            duration: Duration(milliseconds: 350),
            child: OnDispose(
              key: this._videoKey,
              callbackData: this._controller!,
              onDispose: (controller) {
                WidgetsBinding.instance!.addPostFrameCallback((_) async {
                  if (this.mounted && this._oldControllers.contains(controller)) {
                    // Dispose old controller if mounted.
                    // If we are not mounted it will be disposed soon in
                    // dispose().
                    this._oldControllers.remove(controller);
                    controller.dispose();
                    // Play new
                    this.setState(() {
                      this._controller!.play();
                    });
                  }
                });
              },
              child: AspectRatio(
                aspectRatio: this._controller!.value.aspectRatio,
                child: VideoPlayer(this._controller!),
              ),
            ),
          )
        : AspectRatio(
            aspectRatio: 4 / 3,
            child: this._mayShowSpinner
                ? Center(child: new CircularProgressIndicator())
                : Container(),
          );
  }
}
