[copybara] Fast forward flutter/plugins repo after master->main migration I'm not sure why the master->main requires a fast forward, but running this should fix the alerts.

Someone with flutter-gob-owners access will need to run the following:

```sh
$ export REPO=plugins
$ gob-ctl <<EOF
update {
  repo: "flutter/mirrors/$REPO"
  meta {
    remote_config {
      url: "git://github.com/flutter/$REPO.git"
      fetch_poll_frequency_sec: 3600
      fetch: "+refs/heads/*:refs/heads/*"
      clone: true
    }
  }
}
EOF
```

