[Semantics IOS] Accessibility Inspector does not read widgets when widget is not fully viewable  This may be related to this other issue: #97812 

### Description
After further testing we found that when a vertical list view has a widget that is not fully visible, the screen reader does not traverse the list. See code and demo.

### Evidence:

https://user-images.githubusercontent.com/12037033/156066383-3a1986e0-1cdd-4ce4-8c8c-2bd51d0a885d.mp4

Notice the screen reader gets stuck and will not scroll to the green widget. I manually scrolled after to demo the full list.

### Code:
```dart
@override
  Widget build(BuildContext context) {
    return Scaffold(
      body: SafeArea(
        child: ListView(
          shrinkWrap: true,
          children: [
            Semantics(
              label: 'Blue BOX',
              child: Padding(
                padding: const EdgeInsets.all(8.0),
                child: Container(
                  width: 100,
                  height: 500,
                  color: Colors.blue,
                ),
              ),
            ),
            Semantics(
              label: 'Red BOX',
              child: Padding(
                padding: const EdgeInsets.all(8.0),
                child: Container(
                  width: 100,
                  height: 500,
                  color: Colors.red,
                ),
              ),
            ),
            Semantics(
              label: 'Green BOX',
              child: Padding(
                padding: const EdgeInsets.all(8.0),
                child: Container(
                  width: 100,
                  height: 500,
                  color: Colors.green,
                ),
              ),
            ),
          ],
        ),
      ),
    );
  }
```

TextField context menus do not show after focus switch When you change the focus away from a textfield and focus it again the context menu does not show up on the first try. You need either to refocus it again or making a small edit like adding a letter or removing it:

![ya](https://user-images.githubusercontent.com/15329494/155884030-f125be79-3f57-463b-bc81-5a4aa4d80149.gif)


Minimal example code:
```dart
import 'package:flutter/material.dart';

void main() {
  runApp(const MyApp());
}

class MyApp extends StatelessWidget {
  const MyApp({Key? key}) : super(key: key);

  @override
  Widget build(BuildContext context) {
    return const MaterialApp(
      home: Home(),
    );
  }
}

class Home extends StatelessWidget {
  const Home({Key? key}) : super(key: key);

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      body: Center(
          child: SizedBox(
              width: 100,
              child: Column(
                children: const [
                  TextField(),
                  TextField(),
                ],
              ))),
    );
  }
}
```
